import Feels from './Icons/Feels'
import Pop from './Icons/Pop'
import Pressure from './Icons/Pressure'
import Visibility from './Icons/Visibility'
import Wind from './Icons/Wind'
import Humidity from './Icons/Humidity'

type Props = {
  icon: 'wind' | 'feels' | 'humidity' | 'visibility' | 'pressure' | 'pop'
  title: string
  //   info: string | JSX.Element
  //   description: string
}

const icons = {
  wind: Wind,
  feels: Feels,
  humidity: Humidity,
  visibility: Visibility,
  pressure: Pressure,
  pop: Pop,
}

function Tile({
  icon,
  title,
}: //, info, description
Props): JSX.Element {
  const Icon = icons[icon]
  return (
    <article className="w-[140px] h-[130px] text-zinc-700 bg-white/20 backdrop-blur-lg rounded drop-shadow-lg p2 mb-5 flex flex-col  justify-between">
      <Icon />
    </article>
  )
}

export default Tile
